DELIMITER $$
CREATE TRIGGER `check-reviews-ranges-insert` BEFORE INSERT ON `reviews` FOR EACH ROW BEGIN
	IF NEW.originality IS NOT NULL THEN
        IF NEW.originality < 0 THEN
            SET NEW.originality = 0;
        ELSEIF NEW.originality > 5 THEN
            SET NEW.originality = 5;
        END IF;
    END IF;
    
    IF NEW.tech_quality IS NOT NULL THEN
        IF NEW.tech_quality < 0 THEN
            SET NEW.tech_quality = 0;
        ELSEIF NEW.tech_quality > 5 THEN
            SET NEW.tech_quality = 5;
        END IF;
    END IF;
    
    IF NEW.lang_quality IS NOT NULL THEN
        IF NEW.lang_quality < 0 THEN
            SET NEW.lang_quality = 0;
        ELSEIF NEW.lang_quality > 5 THEN
            SET NEW.lang_quality = 5;
        END IF;
    END IF;
END
$$
DELIMITER ;
